import React, { Component } from 'react';

class CourseItem extends Component {
    render() {
        return (
            <div className="form-check">
            <input className="form-check-input ml-1" type="radio" id="radio" value={this.props.course}/>
            <label class="form-check-label" for="radio">{this.props.name} <br/>
            {this.props.teacher}</label>
           </div> 
        );
    }
}

export default CourseItem;
